INSERT INTO `mangas` VALUES (1,'One Piece','Action/Adventure/Comedy/Fantasy/Shonen','HOT/NEW','one_piece.jpg','One Piece là câu truyện kể về Luffy và các thuyền viên của mình. Khi còn nhỏ, Luffy ước mơ trở thành Vua Hải Tặc. Cuộc sống của cậu bé thay đổi khi cậu vô tình có được sức mạnh có thể co dãn như cao su, nhưng đổi lại, cậu không bao giờ có thể bơi được nữa. Giờ đây, Luffy cùng những người bạn hải tặc của mình ra khơi tìm kiếm kho báu One Piece, kho báu vĩ đại nhất trên thế giới. Trong One Piece, mỗi nhân vật trong đều mang một nét cá tính đặc sắc kết hợp cùng các tình huống kịch tính, lối dẫn truyện hấp dẫn chứa đầy các bước ngoặt bất ngờ và cũng vô cùng hài hước đã biến One Piece trở thành một trong những bộ truyện nổi tiếng nhất không thể bỏ qua. Hãy đọc One Piece để hòa mình vào một thế giới của những hải tặc rộng lớn, đầy màu sắc, sống động và thú vị, cùng đắm chìm với những nhân vật yêu tự do, trên hành trình đi tìm ước mơ của mình.'),(2,'Jujutsu Kaisen','Action/Fantasy/Shonen','HOT/NEW','jujutsu_kaisen.jpg','Yuuji Itadori là một thiên tài có tốc độ và sức mạnh, nhưng cậu ấy muốn dành thời gian của mình trong Câu lạc bộ Tâm Linh. Một ngày sau cái chết của ông mình, anh gặp Megumi Fushiguro, người đang tìm kiếm vật thể bị nguyền rủa mà các thành viên CLB đã tìm thấy. Đối mặt với những con quái vật khủng khiếp bị \"Ám\", Yuuji nuốt vật thể bị phong ấn để có được sức mạnh của nó và cứu bạn bè của mình! Nhưng giờ Yuuji là người bị \"Ám\", và cậu ấy sẽ bị kéo vào thế giới ma quỷ ly kỳ của Megumi và những con quái vật độc ác ...'),(3,'Undead Unluck','Comedy/Shonen','HOT/NEW','undead_unluck.jpg','Một cô gái có khả năng khiến cho những ai tiếp xúc với cô gặp xui xẻo, tùy theo mức độ tiếp xúc và thời gian mà vận xui lớn hay nhỏ. Cô chán nản định tìm cái chết; thì tình cờ một người bất tử cũng đang muốn chết.'),(4,'Bleach','Action/Adventure/Comedy/Fantasy/Shonen','HOT/NEW','bleach.jpg','Nhân vật chính của Bleach là Ichigo Kurosaki có khả năng nhìn thấy những hồn ma. Cuộc sống của cậu thay đổi khi cậu gặp Rukia Kuchiki, một Thần Chết và là thành viên của Âm Giới. Khi chiến đấu với một yêu quái chuyên đi săn những người có năng lực tâm linh, Rukia đã cho Ichigo mượn sức mạnh của mình để cậu có thể cứu gia đình mình. Nhưng trước sự ngạc nhiên của Rukia, Ichigo đã hấp thu toàn bộ sức mạnh của cô. Khi đã trở thành một Thần Chết, Ichigo nhanh chóng biết được rằng thế giới cậu đang sống chứa đầy những linh hồn nguy hiểm, và cùng với Rukia, người đang từ từ khôi phục lại sức mạnh của mình, công việc của Ichigo lúc này là bảo vệ những người vô tội khỏi lũ yêu quái và giúp đỡ những linh hồn tìm được nơi yên nghỉ. Không dừng lại tại đó, trong Bleach, Ichigo sẽ dần phải đụng độ với các tổ chức hùng mạnh, với những âm mưu đan xen để bảo vệ thế giới. Mỗi phần của truyện đều có liên kết chặt chẽ với nhau chứ không tách rời. Đọc Bleach, bạn khó có thể dừng theo dõi các trận chiến hoành tráng và hấp dẫn nối tiếp nhau.'),(5,'One-Punch Man','Action/Adventure/Comedy/Shonen','FULL/HOT','one_punch_man.jpg','Onepunch-Man là một Manga thể loại siêu anh hùng với đặc trưng phồng tôm đấm phát chết luôn… Lol!!! Nhân vật chính trong Onepunch-man là Saitama, một con người mà nhìn đâu cũng thấy “tầm thường”, từ khuôn mặt vô hồn, cái đầu trọc lóc, cho tới thể hình long tong. Tuy nhiên, con người nhìn thì tầm thường này lại chuyên giải quyết những vấn đề hết sức bất thường. Anh thực chất chính là một siêu anh hùng luôn tìm kiếm cho mình một đối thủ mạnh. Vấn đề là, cứ mỗi lần bắt gặp một đối thủ tiềm năng, thì đối thủ nào cũng như đối thủ nào, chỉ ăn một đấm của anh là… chết luôn. Liệu rằng Onepunch-Man Saitaman có thể tìm được cho mình một kẻ ác dữ dằn đủ sức đấu với anh? Hãy theo bước Saitama trên con đường một đấm tìm đối cực kỳ hài hước của anh!!'),(6,'My Hero Academia','Action/Adventure/Comedy/Shonen','FULL/HOT/NEW','my_hero_academia.jpg','Vào tương lai, lúc mà con người với những sức mạnh siêu nhiên là điều thường thấy quanh thế giới. Đây là câu chuyện về Izuku Midoriya, từ một kẻ bất tài trở thành một siêu anh hùng. Tất cả ta cần là mơ ước.'),(7,'Dragon Ball','Action/Adventure/Comedy/Fantasy/Shonen','FULL/HOT','dragon_ball.jpg','Câu truyện kể về một cậu bé tên Songoku cùng nhóm bạn của mình tham gia những chuyến phiêu lưu tìm ngọc rồng, chống lại cái ác bảo vệ trái đất. Nhân vật Songoku được mọi người ưa thích bởi tính thánh thiện và ngây ngô của mình. Câu truyện lôi cuốn người qua những tình huống phiêu lưu kì thú, những pha đấu võ đẹp mắt, và những tình huống hài hước. Dragon ball là bộ truyện tranh thuộc nhóm nổi tiếng nhất thế giới, được rất nhiều bạn trẻ ưa thích.'),(8,'Naruto','Action/Adventure/Comedy/Fantasy/Shonen','FULL/HOT','naruto.jpg','Bối cảnh Naruto xảy ra vào mười hai năm trước khi câu chuyện chính thức bắt đầu, một con hồ ly chín đuôi đã tấn công Konohagakure. Nó là một con quái vật có sức mạnh khủng khiếp, chỉ một cái vẫy từ một trong chín cái đuôi của nó có thể tạo ra những cơn sóng thần và san bằng nhiều ngọn núi. Nó gây ra sự hỗn loạn và giết chết rất nhiều người cho đến khi người đứng đầu làng Lá – Hokage đệ tứ – đã đánh bại nó bằng cách đổi lấy mạng sống của mình để phong ấn nó vào trong người một đứa trẻ mới sinh. Đứa trẻ đó tên là Uzumaki Naruto. Bộ truyện kể về cuộc hành trình đầy gian khổ với vô vàn khó khăn, thử thách của Naruto từ khi còn là một cậu bé tới khi trở thành một trong những nhẫn giả vĩ đại nhất. Không chỉ mô tả về một thế giới nhẫn giả huyền bí, Naruto còn mang trong nó nhiều ý nghĩa nhân sinh sâu sắc về tình bạn, tình đồng đội, tình yêu, ước mơ và hi vọng.'),(9,'Toriko','Action/Adventure/Comedy/Shonen','FULL/HOT/NEW','toriko.jpg','Câu chuyện kể vể Toriko một thợ săn pro thường xuyên cung cấp các loại thực phẩm quý giá cho nhà hàng và những người giàu có, một anh chàng có đầy sức mạnh để săn bắt các loài động vật hung dữ.'),(10,'Spy x Family','Action/Adventure/Comedy/Shonen','HOT','spy_x_family.jpg','Anh điệp viên lấy vợ sát thủ và có con siêu năng.'),(11,'Sakamoto Days','Action/Comedy/Shonen/Slice Of Life','HOT','sakamoto_days.jpg','Taro Sakamoto là sát thủ huyền thoại, được các nhân vật phản diện khiếp sợ và các sát thủ ngưỡng mộ. Nhưng một ngày... anh đã yêu! Giải nghệ, kết hôn, làm cha và sau đó... Sakamoto đã trở thành con lợn sề! Anh chàng mũm mĩm điều hành cửa hàng hàng xóm thực sự là một cựu sát thủ huyền thoại giấu nghề! Liệu anh ấy có thể bảo vệ gia đình mình khỏi nguy hiểm? Hãy sẵn sàng để trải nghiệm một bộ manga shounen hài hành động mới! Được xuất bản hàng tuần trên Tạp chí Shounen'),(12,'Fairy Tail','Adventure/Fantasy','FULL/HOT','fairy_tail.jpg','Xin đón chào các bạn đến với Fairy Tail – một thế giới tràn đầy phép thuật, những pháp sư có thể hô mưa, gọi gió, những con mèo biết bay và những quái vật trong truyền thuyết. Tại vùng đất Fiore, bạn sẽ gặp được tổ chức Fairy Tail, một tổ chức pháp sư có những thành viên vui tính, thú vị và mạnh mẽ nhất. Câu chuyện bắt đầu khi cô gái trẻ Lucy, người có khả năng kêu gọi các tinh linh và ước mơ được gia nhập một tổ chức phù thủy gặp được hỏa pháp sư Natsu đang trên đường tìm kiếm cha nuôi của mình tại thị trấn cảng Harujion… Trong Fairy Tail, bạn sẽ gặp gỡ cặp “chó mèo” Natsu “khạc ra lửa” và “xơi lửa” cùng Gray “băng giá”, Lucy, Erza tài giỏi và “sexy”, theo kèm là những chú mèo ngộ nghĩnh cùng rất nhiều các pháp sư với đủ loại phép thuật kỳ lạ.'),(13,'Hunter x Hunter','Action/Adventure/Fantasy/Shonen','HOT','hunter_x_hunter.jpg','Hunter X Hunter là câu chuyện về các thợ săn (Hunter) – những người có khả năng thực hiện những nhiệm vụ đặc biệt như săn tìm các báu vật, những loài thú ma thuật, và thậm chí là cả những người khác nữa. Nhưng công việc như vậy đòi hỏi phải được chứng nhận, và cứ một trăm nghìn người thì mới có một người có thể vượt qua được cuộc kiểm tra cực kì khó khăn. Những người vượt qua cuộc kiểm tra này sẽ được quyền đi vào những khu vực cấm, những nơi lưu trữ thông tin tối mật và được gọi là Hunter. Nhân vật chính của Hunter X Hunter là Gon, một cậu bé có ước mong trở thành một thợ săn để có thể tìm được cha mình, một thợ săn huyền thoại. Trên con đường phiêu lưu của mình trong thế giới của Hunter X Hunter, cậu đã gặp Killua, con trai một gia tộc sát thủ số một thế giới, Clapika, tộc nhân duy nhất còn sót lại của tộc Mắt Đỏ, và Leorio, một anh chàng tính tình thẳng thắn với mơ ước trở thành bác sĩ. Cùng nhau, họ đã đối phó với các đối thủ sừng sỏ, những băng nhóm tội phạm khét tiếng, và cả những loài quái vật với sức mạnh và trí thông minh còn hơn cả loài người. Hunter X Hunter hấp dẫn từ cách xây dựng từng nhân vật, tới nội dung độc đáo, có chiều sâu, với cách thắt mở tình huống vô cùng tài tình của tác giả đã khiến cho bộ truyện trở thành một trong những bộ manga được yêu thích nhất từ trước tới nay.'),(14,'Berserk','Action/Adventure/Fantasy','HOT','berserk.jpg','Một trong những siêu phẩm của thời đại, Berserk mang dáng vóc của một thế giới rộng lớn trong bối cảnh thời kì Trung cổ châu Âu, cuộc chiến của những hiệp sĩ vĩ đại và thế lực đen tối huyền bí ma quỷ. Một tác phẩm kinh điển cho những ai đã từng đam mê “The Lord of The Ring” hoặc “Star War”, hoành tráng, dữ dội, vinh quang và nước mắt. Truyện kể về Gatts, hay Black Swordsman, trong cuộc hành trình của anh đi tìm lối thoát và trả thù Griffith, người bạn thân nhất, người thủ lĩnh đã bán đứng toàn bộ quân đội cho ác quỉ để đạt được giấc mơ của mình. Gatts và người yêu của anh, Caska, chịu 1 lời nguyền như vật “ hiến tế” cho Griffith và luôn bị săn lùng bởi vô số ác quỷ. Chiến đấu liên tục không ngừng nghỉ, Gatts với một sức mạnh phi thường từ tuổi thơ khắc nghiệt và những năm tháng trên chiến trường, vung thanh gươm Dragon khổng lồ xẻ nát những gì cản đường anh, để bảo vệ người yêu, để sống sót.'),(15,'Detective Conan','Adventure/Fantasy/Shonen','HOT','detective_conan.jpg','Nhân vật chính của truyện là một thám tử học sinh trung học có tên là Kudo Shinichi, người đã bị biến thành một cậu bé cỡ học sinh tiểu học và luôn cố gắng truy tìm tung tích tổ chức Áo Đen nhằm lấy lại hình dáng cũ.'),(16,'Welcome to Demon School! Iruma-kun','Comedy/Fantasy/Shonen','HOT','welcome_to_demon_school_iruma_kun.jpg','Mairimashita! Iruma-kun là câu chuyện kể về cậu bé Suzuki Iruma, người đã bị bố mẹ mình kí khế ước bán cho ác ma để đổi lấy tiền tài và bình an. Cậu bé Iruma đáng thương từ lúc mới biết đi (1 tuổi) đã phải \"ra xã hội\" lăn lộn, buôn ba khắp nơi với hai vị phụ huynh \"tưng tửng\" cho đến ngày một Ác Ma đến rước cậu đến Ma giới theo khế ước. Tưởng chừng như sắp vào bụng quỷ thì vị Ác Ma già nua này đã khóc lóc yêu cầu cậu làm cháu trai ông ta, với bản tính lương thiện và tốt bụng đến cả bản thân mình cũng phải kinh ngạc, cậu bất đắc dĩ đã đồng ý lời đề nghị đó và nhập học trường Ác Ma theo ý ông ta. Chuyện gì sẽ xảy ra tiếp theo, mời các bạn theo dõi cuộc sống học đường đầy bất thường của Iruma-kun.'),(17,'Made In Abyss','Action/Adventure/Fantasy','FULL','made_in_abyss.jpg','Hệ thống hang động khổng lồ, nơi duy nhất trên thế giới còn chưa được khám phá hay còn được biết đến với cái tên, Abyss. Không ai biết được mê cung bí ẩn này sâu xuống bao nhiêu, có những quái vật cũng như di tích nào. Rất nhiều nhà thám hiểm đã dấn thân vào công cuộc thám hiểm nơi đâu. Qua thờii gian, những ai có đủ can đảm để bước xuống mê cung này thường được gọi bằng cái tên Thám hiểm gia hang động. Ở Oosu, thị trấn bên rìa Abyss, có một cô bé mồ côi tên là Rico, nuôi ước trở thành một thám hiểm gia hang động như mẹ cô mà giải được bí ẩn cả Abyss. Một ngày nọ khi đang khám phá những bí ẩn bên dưới Abyss, cô đã gặp được một cậu bé robot…'),(18,'Attack on Titan','Action/Shonen/Historical','FULL','attack_on_titan.jpg','Hơn 100 năm trước, giống người khổng lồ Titan đã tấn công và đẩy loài người tới bờ vực tuyệt chủng. Những con người sống sót tụ tập lại, xây bao quanh mình 1 tòa thành 3 lớp kiên cố và tự nhốt mình bên trong để trốn tránh những cuộc tấn công của người khổng lồ. Họ tìm mọi cách để tiêu diệt người khổng lồ nhưng không thành công. Và sau 1 thế kỉ hòa bình, giống khổng lồ đã xuất hiện trở lại, một lần nữa đe dọa sự tồn vong của con người....  Elen và Mikasa phải chứng kiến một cảnh tượng cực kinh khủng - mẹ của mình bị ăn thịt ngay trước mắt. Elen thề rằng cậu sẽ giết tất cả những tên khổng lồ mà cậu gặp.....'),(19,'The Seven Deadly Sins','Action/Adventure/Comedy/Fantasy/Shonen','FULL','the_seven_deadly_sins.jpg','“Thất đại ác nhân”, một nhóm chiến binh có tham vọng lật đổ vương quốc Britannia, được cho là đã bị tiêu diệt bởi các “hiệp sĩ thánh chiến” mặc dù vẫn còn 1 số người cho rằng họ vẫn còn sống. 10 năm sau, Các hiệp sĩ thánh chiến đã làm 1 cuộc đảo chính và khống chế đức vua, họ trở thành người cai trị độc tài mới của vương quốc. Elizabeth, con gái duy nhất của nhà vua, đã lên đường tìm “thất đại ác nhân” để nhờ họ tái chiếm lại vương quốc. Công chúa có thành công trong việc tìm kiếm “thất đại ác nhân”, các “hiệp sĩ thánh chiến” sẽ làm gì để ngăn chăn cô? xem các chap truyện sau sẽ rõ.'),(20,'Dr.Stone','Action/Adventure/Shonen','FULL','dr_stone.jpg','Sau 1 trận đại dịch không rõ nguồn gốc khiến loài người trên toàn thể địa cầu biến thành đá trải qua mấy ngàn năm sau 2 thanh niên chính của chúng ta là Senkuu và Taiju phá đá thoát ra và bắt đầu lập kế hoạch để cùng nhau tái thiết lập lại thế giới theo cách của họ...'),(21,'Mashle: Magic And Muscles','Action/Comedy/Shonen','FULL','mashle_magic_and_muscles.jpg','Ngày xửa ngày xưa, có một thế giới nơi phép thuật có thể chi phối mọi thứ. Nhưng sâu trong rừng có một thanh niên dành thời gian để luyện tập cơ bắp. Mặc dù không thể sử dụng phép thuật, nhưng cậu ta có một cuộc sống yên bình với cha mình. Rồi một ngày, cuộc sống của cậu gặp nguy hiểm! Cơ thể của Saitama sẽ bảo vệ cậu ta khỏi những pháp sư? Cơ bắp được luyện tập của cậu có thể sánh vai với các pháp sư ưu tú ...? Câu chuyện về Saitama ở Hogwarts bắt đầu!'),(22,'Tokyo Ghoul','Shonen','FULL','tokyo_ghoul.jpg','Hàng loạt những vụ giết người kỳ lạ đang xảy ra ở Tokyo, và nhờ chất lỏng bằng chứng tại hiện trường, cảnh sát kết luận thủ phạm chính là \"ghoul\"- quỷ ăn thịt người. Kaneki, một sinh viên đại học thích đọc sách bị một con ghoul tấn công, và từ đó, số phận của chàng trai bắt đầu thay đổi...'),(23,'Jojo’s Bizarre Adventure: Steel Ball Run','Action/Shonen','FULL','jojo_bizarre_adventure_steel_ball_run.jpg','Đây là phần 7 của bộ truyện Jojo’s Bizarre Adventure, nối tiếp phần 6 của bộ truyện, nhưng được đặt ở một thế giới khác. Bối cảnh được đặt tại năm 1890 (cùng thời điểm xảy ra part 1 của Jojo’s Bizarre Adventure). Tại miền viễn tây nước Mỹ, cuộc đua Steel Ball Run với phần thưởng 50 triệu đô đã được diễn ra, với đường đua chạy dọc nước Mỹ và hàng trăm người tham gia. Trong số đó là cựu tay đua nhưng nay đã bị liệt Johnny Joestar, và bậc thầy về kĩ thuật ‘Spin’, Gyro Zeppeli.'),(24,'The Promised Neverland','Shonen','FULL','the_promised_neverland.jpg','Emma và những người bạn sống một cuộc sống bình yên tại trại trẻ mồ côi nơi họ lớn lên. Dù quy định tại đây khá nghiêm ngặt nhưng người mẹ chăm sóc họ thực sự tốt bụng. Nhưng tại sao những đứa trẻ lạibị cấm rời khỏi nơi này...?'),(25,'Nisekoi: False Love','Comedy/Shonen','FULL','nisekoi_false_love.jpg','Em sẽ giữ chìa, còn anh sẽ giữ ổ khóa. Sau này nếu mình được gặp lại nhau thì đây sẽ là thứ chúng ta dùng để nhận ra nhau, và khi đó, chúng ta sẽ… cưới nhau”. Tuổi thơ con người thật hồn nhiên và trong sáng, nhìn cảnh hai đứa trẻ mới tí tuổi đầu đã nói mấy lời đỡ không nổi như thế thật đáng yêu biết bao... Con người là thế... Ai cũng mong rằng mọi thứ sẽ có được một kết quả như những câu chuyện cổ tích... Ấy thế mà... Có những lúc sự thật lại không như con người mong muốn. Rồi cái ngày định mệnh, ngày hai đứa gặp lại, mọi chuyện sẽ ra sao?'),(26,'Yamada-kun and the Seven Witches','Comedy/Shonen','FULL','yamada_kun_and_the_seven_witches.jpg','Yamada Ryuu là học sinh năm 2 tại trường cấp 3 Suzaku. Cậu ta là một kẻ chuyên đi trễ về sớm, ngủ gật trong lớp và điểm số dĩ nhiên là bê bết. Cậu ta cảm thấy đời chán như con gián. Shiraishi Urara, ngược lại, là học sinh sáng giá nhất khối, thông minh lẫn xinh đẹp đủ cả. Rồi một hôm, một chuyện kì lạ đã xảy ra và hai con người này đã bị hoán đổi thân xác cho nhau! Xem để biết thêm chi tiết!'),(27,'Yu-Gi-Oh!','Action/Adventure/Fantasy/Shonen','FULL','yugioh.jpg','Yu-Gi-Oh! là câu chuyện kể về Yugi Muto, một học sinh trường Domino. Tính tình nhút nhát, hiền lành. Cậu là cháu nội của Surodoku Muto. Trước đây, ông cậu vốn là một kiện tướng chơi trò chơi cực kì xuất sắc. Từ nhỏ, ông cậu đã dạy cậu chơi các trò chơi, và ông còn cho cậu một bộ xếp hình. Trong khoảng gần bảy năm, cậu đã tìm tòi và đã lắp ráp được thành Trò chơi ngàn năm (Millennium Puzzle). Nhưng cậu đã không thể hoàn thành được vì mảnh chính của trò chơi bị Joey Wheeler (Katsuya Jonouchi) ném xuống nước vì muốn chơi xỏ Yugi. Nhưng sau đó, cảm kích vì Yugi đã dùng thân mình bảo vệ cậu trong một lần bị một thằng du côn đánh, họ trở thành bạn của nhau. Joey lặn xuống nước và lấy lại mảnh chính đưa cho ông nội Yugi. Cuối cùng, Trò chơi ngàn năm đã hoàn thành. Nhưng kể từ sau khi hoàn thành Trò chơi ngàn năm, Yugi đã xuất hiện một nhân cách khác mặc dù cậu không nhận ra, đó là Yami Yugi. Cho đến khi Dark Bakura, chủ sở hữu Vòng tròn trí tuệ ngàn năm (Millennium Ring) tìm cách hại Yugi và bạn của cậu trong một trò chơi chết người, thì cũng là lúc Yugi phát hiện ra Yami Yugi. Lúc đầu cậu rất hoảng sợ khi Yami Yugi chính là nhân cách thứ hai của mình. Nhưng sau đó họ trở thành bạn của nhau.'),(28,'Kuroko\"s Basketball','Comedy/Shonen','FULL','kurokos_basketball.jpg','“Generation of Miracles”, tên của đội bóng rỗ trường THCS Teikou, đã từng đoạt chức vô địch toàn quốc 3 năm liền . 5 ngôi sao của đội đều là những thiên tài nhưng đã tách ra và theo học ở những trường THPT khác nhau với các đội bóng mạnh . Nhưng có 1 chuyện mà ít người hay biết đó là “Generation of Miracles” còn có 1 thành viên thứ 6 . Kuroko Tetsuya, thành viên thứ 6 của đội tham gia 1 trường THPT với đội bóng rỗ chỉ vừa thành lập 1 năm . Nhưng điều bất ngờ là cậu lại có 1 cơ thể yếu ớt và lại chẳng bao giờ ném banh chính xác . Vậy điều gì đã làm cậu ta trở thành thành viên thứ 6 của “Generation of Miracles”?'),(29,'Inuyasha','Action/Adventure/Fantasy/Shonen/Historical','FULL','inuyasha.jpg','Bộ truyện tranh Inuyasha hay còn được gọi là Khuyển Dạ Xoa có tên ban đầu là Sengoku Otogizōshi InuYasha là bộ truyện tranh của tác giả Takahashi Rumiko kể về câu chuyện phiêu lưu về quá khứ kỳ lạ của một nữ sinh trung học Kagome cùng với nhân vật chinh là một bán yêu có tên Inu Yasha. Mở đầu câu chuyện là khi Inu Yasha tấn công một ngôi làng nhằm mục đích cướp đi viên ngọc Tứ Hồn hay còn gọi là Shikon no Tama. Tuy nhiên Inu Yasha đã bị nữ pháp sư của ngôi làng là Kikyo ngăn cản và phong ấn trên một gốc cây. Trong lúc đó ở tương lai 550 năm sau đó. Higurashi Kagome, một nữ sinh trung học đang tổ chức tiệc sinh nhật lần thứ 15 của mình bất ngờ bị một con yêu quái từ chiếc giếng cạn sau nhà tấn công. Bất ngờ bị rơi xuống giếng, Kagome bị đưa trở lại quá khứ 500 năm trước, khi mà Inu Yasha đã trải qua phong ấn được 50 năm. Tình thế gấp rút vì bị con yêu quái đuổi theo từ chiếc giếng, Kagome đã giải thoát cho Inu Yahsa khỏi phong ấn. Từ đây câu chuyện tình yêu giữa một người và một bán yêu cùng những rắc rối mà họ sẽ gặp phải bắt đầu... Một số nhân vật chính trong truyện: Inu Yasha : Là nhân vật nam chính của truyện, là một bán yêu thừa hưởng thanh đao có tên là Thiết Toái Nha làm từ răng nanh của cha mình. Higurashi Kagome : Là nhân vật nữ chính trong bộ truyện, là một nữ sinh trung học thời hiện đại 550 sau tính theo thời gian diễn biến trong truyện. Là đầu thai kiếp sau của nữ pháp sư Kikyo, sở hữu sức mạnh cũng như năng lực của Kikyo. Kikyo : Nữ pháp sư đã phong ấn và là mối tình đầu của Inu Yasha Sesshomaru : Người anh cùng cha khác mẹ của Inu Yasha, là dòng máu yêu thuần chủng, luôn ghét bỏ Inu do dòng máu lai của mình. Cùng các nhân vật khác như : Shippo,Miroku, Sango…'),(30,'Hanma Baki','Action/Shonen','FULL','baki.jpg','Baki Hanma là con trai của Yuujirou Hanma, sinh vật mạnh nhất trên trái đất khiến các quốc gia kinh sợ. Anh là một đội quân đơn độc có thể tạo ra hoặc ngăn chặn động đất chỉ bằng một cú đấm. Anh đã có tiếng vang trong việc tiêu diệt các chiến dịch quân sự lớn chỉ bằng đôi đấm của mình.'),(31,'Dragon Quest','Action/Adventure/Fantasy/Shonen','FULL','dragon_quest.jpg','Dragon Quest: Dai no Daibouken (Dai\"s Great Adventure) là một bộ manga được vẽ dựa theo loạt game Daragon Quest. Bộ manga này trước đây từng được xuất bản với 2 chương ngắn \"Derupa! Iruiru”. Sau đó, thành công của nó đã dẫn đến việc ra đời thêm 3 chương \"Dai Bakuhatsu!!!\" (Dai Explodes!!!). Cuối cùng thì nó được kéo dài thành bộ Dai no Daibouken gồm 37 tập. Sau này nó cũng được chuyển thể thành anime, cũng là sản phẩm thứ 2 dựa theo series Dragon Quest mà Dragon Quest: Abel Yuusha (được biết đến nhiều với cái tên Dragon Warrior) là sản phẩm đầu tiên.'),(32,'Death Note','Adventure/Shonen','FULL','death_note.jpg','Light Yagami là một thiếu niên thiên tài với khả năng quan sát và suy luận tuyệt vời - và cậu cảm thấy cuộc sống của mình nhàm chán. Nhưng mọi việc hoàn toàn thay đổi khi cậu tìm thấy quyển sổ Thần Chết - Death Note, một quyển sổ do một thần chết cố tình đánh rơi. Bất cứ người nào bị ghi tên vào trong quyển sổ sẽ phải chết, và Light quyết định sử dụng quyển sổ để tiêu diệt cái ác trên thế giới...');
