--
-- Table structure for table `mgchapters`
--

DROP TABLE IF EXISTS `mgchapters`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `mgchapters` (
  `idchapter` int NOT NULL AUTO_INCREMENT,
  `idmg` int NOT NULL,
  `chaptername` mediumtext NOT NULL,
  `imgpack` varchar(45) NOT NULL,
  `ordnumber` int NOT NULL,
  `imgnumber` int DEFAULT NULL,
